import React from "react";
import "./App.css";
import About from "./About";
import Portfolio from "./Portfolio";
import Nav from "./Nav";

function App() {
  return (
    <div>
      <Nav />
      <About />
      <Portfolio />
    </div>
  );
}

export default App;
